import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { Button } from '@mui/material';
import { Link } from 'react-router-dom';
// import './LandingPage.css';  // Create a CSS file to style your components


const LandingPage = () => {
  return (
    <Container fluid className="landing-page">
      <Row>
        <Col md={6}>
          <div className="video-container">
            <iframe
              src="https://assets.pinterest.com/ext/embed.html?id=767441592761388596"
              height="500"
              width="100%"
              frameBorder="0"
              scrolling="no"
              title="Background Video"
            ></iframe>
          </div>
        </Col>
        <Col md={6} className="content-section">
          <h1>Welcome to Prograde</h1>
          <div className="route-search">
            <input type="text" placeholder="Search for a route..." />
            <Button variant="contained" component={Link} to="/route">Search</Button>
          </div>
          <div className="recent-activity">
            <h2>Recent Comments</h2>
            {/* Here you will map through your comments data and display them with user avatars */}
            <h2>Recent Threads</h2>
            {/* Here you will map through your threads data and display them with user avatars */}
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default LandingPage;
